const promotion = { 
    "id":1, 
    "title":"conta numero um",
    "price":9.99,

}

const PagesPromotionSearch = () => {
  useEffect(() => { 

  }, )

  axios.get('http://localhost:5000/promotions')
    .then((response) => {
      console.log(response.data)
    })

  return (
    <>
      <h1>Despesas</h1>
      <PromotionCard promotion={promotion} />
    </>
  );
}

export default PagesPromotionSearch;
